    "arab": "الْحَمْدُ لِلهِ الَّذِيْ عَلاَ فَقَهَرَ، وَالْحَمْدُ لِلهِ الَّذِيْ بَطَنَ فَخَبَرَ، وَالْحَمْدُ لِلهِ الَّذِيْ مَلَكَ فَقَدَرَ، وَالْحَمْدُ لِلهِ الَّذِيْ يُحْيِيْ الْمَوْتَى وَيُمِيْتُ اْلأَحْيَاءَ، وَهُوَ عَلَى كُلِّ شَيْئٍ قَدِيْرٌ 3x\\r\\nAlhamdulillahilladzii ‘alaa faqohara, walhamdulillahilladzi bathona fakhobaro, walhamdulillahilladzii malaka faqodoro, walhamdulillahilladzii yuhyiilmauta wa yumiitul ahyaa a, wahuwa ‘alaakulli syaiin qodiirun.\\r\\nSegala puji bagi Allah yang meninggikan dan menundukkan. Segala puji bagi Allah yang tersembunyi dan memberitahu. Segala puji bagi Allah yang memiliki dan menentukan. Segala puji bagi Allah yang menghidupkan orang mati dan mematikan orang hidup. Dia Maha Kuasa atas segala sesuatu.",
